import React from "react";
import { v4 } from "uuid";
const NotiProv = (props) => {
  const notifications = [
    {
      id: v4(),
    },
  ];
  console.log(notifications);
  return (
    <div>
      <div className={"notification-wrapper"}>
        {notifications.map(note => {
          return <Notification {...note} />
        })}
      </div>
      {props.children}
    </div>
  );
};

export default NotiProv;
